import logo from './logo.svg';
import './App.css';
import { Button, Alert } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Alert>This is a button</Alert>
        <button>Test Button</button>
      </header>
    </div>
  );
}

export default App;
